INSERT INTO `cms_block` VALUES (1,'Pixtron Home Blogs','Pixtron-home-blogs','<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;div class=\"hb-wrapper above-padding below-padding\"&gt;\r\n    &lt;div class=\"page-main\"&gt;\r\n        &lt;div class=\"page-title-main\"&gt;&lt;strong&gt;Latest Posts&lt;/strong&gt;&lt;/div&gt;\r\n        &lt;div class=\"hb-row\"&gt;\r\n            &lt;div class=\"hb-blog\"&gt;\r\n                &lt;ul id=\"hb-blogs\"&gt;\r\n                    &lt;li style=\"display: none;\"&gt;\r\n                        &lt;div class=\"hb-inner\"&gt;\r\n                            &lt;div class=\"hb-img\"&gt;\r\n                                    &lt;img src=\"{{media url=wysiwyg/450x250_2.jpg}}\" alt=\"\" /&gt;\r\n                                     &lt;span&gt; 10 Dec 2021 &lt;/span&gt;\r\n                            &lt;/div&gt;\r\n                            &lt;div class=\"hb-content\"&gt;\r\n                                &lt;h3&gt;Cng ngh mi 2021.&lt;/h3&gt;\r\n                                &lt;p&gt;&lt;/p&gt;\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/li&gt;tr\r\n                    &lt;li style=\"display: none;\"&gt;\r\n                        &lt;div class=\"hb-inner\"&gt;\r\n                            &lt;div class=\"hb-img\"&gt;\r\n                                     &lt;img src=\"{{media url=wysiwyg/450x250_3.jpg}}\" alt=\"\" /&gt;\r\n                                     &lt;span&gt; 12 Dec 2021 &lt;/span&gt;\r\n                            &lt;/div&gt;\r\n                            &lt;div class=\"hb-content\"&gt;\r\n                                &lt;h3&gt;Internet kt ni vn vt&lt;/h3&gt;\r\n                                &lt;p&gt;Gii thiu v internet kt ni vn vt v nhng hng i pht trin trong tng lai&lt;/p&gt;\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/li&gt;\