 src=\"{{media url=wysiwyg/100x100_1.png}}\" alt=\"testimonial-image\" /&gt;\r\n                                     &lt;span&gt;\r\n                                    &lt;h4&gt;&lt;/h4&gt;\r\n                                    &lt;p&gt;&lt;/p&gt;\r\n                                &lt;/span&gt;\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/li&gt;\r\n                  \r\n                    &lt;li style=\"display: none;\"&gt;\r\n                        &lt;div class=\"hb-inner\"&gt;\r\n                            &lt;div class=\"hb-content\"&gt;\r\n                                &lt;p&gt; Trong cuc sng, ni no c mt ngi chin thng, ni  c mt ngi thua cuc. Nhng ngi bit hi sinh v ngi khc lun lun l ngi chin thng.&lt;/p&gt;\r\n                            &lt;/div&gt;\r\n                            &lt;div class=\"hb-image\"&gt;\r\n&lt;img src=\"{{media url=wysiwyg/100x100_3.png}}\" alt=\"testimonial-image\" /&gt;\r\n                                     &lt;span&gt;\r\n                                    &lt;h4&gt;&lt;/h4&gt;\r\n                                    &lt;p&gt;&lt;/p&gt;\r\n                                &lt;/span&gt;\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/li&gt;\r\n                &lt;/ul&gt;\r\n                &lt;script type=\"text/javascript\" xml=\"space\"&gt;\r\n                    require([\'jquery\', \'pixtronowlcarousel\'], function() {\r\n                        jQuery(document).ready(function() {\r\n                            jQuery(\"#hb-testimonials\").owlCarousel({\r\n                                items: 1,\r\n                                itemsDesktop: [1198, 1],\r\n                                itemsDesktopSmall: [1023, 1],\r\n                                itemsTablet: [768, 1],\r\n                                itemsTabletSmall: [767, 1],\r\n                                itemsMobile: [479, 1]